// Main Application Component ("App") with Routing:
// This file sets up routing for each page in the React app.

import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Login from './components/Login';
import LandingPage from './components/LandingPage';
import CategoryPage from './components/CategoryPage';
import CartPage from './components/CartPage';
import ScheduleReview from './components/ScheduleReview';
import Oauth from './components/Oauth';

// Set up the routes to each page
function App() {
  return (
    // Router wraps all routes and allows navigation between pages
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" exact component={Login} />
          <Route path="/landing" component={LandingPage} />
          <Route path="/categories" component={CategoryPage} />
          <Route path="/cart" component={CartPage} />
          <Route path="/schedule-review" component={ScheduleReview} />
          <Route path="/oauth" component={Oauth} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
